import React from "react";
import { Link as RouterLink } from "react-router-dom";
import { Link } from "@material-ui/core";

const Contacts = ({ contacts }) => {
  return (
    <div>
      <center>
        <h1 style={{ fontSize: 45, color: "grey" }}>CinemaWorld Movies</h1>
      </center>
      {contacts.map((contact) => (
        <div class="card">
          <div class="card-body">
            <div>
              <Link
                color="inherit"
                component={RouterLink}
                variant="h6"
                to="/databaseclients/details"
                onClick={() => {
                  dispatch(getClient(client));
                }}
              >
                {client.clientName}
              </Link>
            </div>
            <h5 class="card-title" onClick={console.log("clicked")}>
              {contact.Title}
            </h5>
            <h6 class="card-subtitle mb-2 text-muted">{contact.Title}</h6>
            <p class="card-text">{contact.Type}</p>
          </div>
        </div>
      ))}
    </div>
  );
};

export default Contacts;
